import { useNavigation } from "@react-navigation/native";
import React from "react";
import {StyleSheet, Text,TouchableOpacity,View,SafeAreaView,Image} from "react-native";
import { ScrollView } from "react-native-gesture-handler";




export default function Dashboard(){

    const navigation=useNavigation()
    
    return(
         <SafeAreaView style={styles.container}>
         <View  style={styles.textImage}>
          <Image style={styles.Image} source={require("../../../assets/BARBA.jpg")} />
          </View> 
         
          <ScrollView>
          <TouchableOpacity onPress={()=> navigation.navigate("Consultar")}>
        </TouchableOpacity>
      
          </ScrollView> 
          
        <TouchableOpacity onPress={()=> navigation.navigate("Big")}>
        </TouchableOpacity>
        </SafeAreaView>
    )
}
 const styles=StyleSheet.create({
    container:{
        fle:1,
        backgroundColor:"#FFF",
    },
    text:{
    marginTop:30,
     marginBottom:30,
    fontSize:30,
    color:'#D92938',
    fontWeight: 'bold',
    textAlign:"center", 
    },
   Image:{ 
   width:"100%",
   height:300,
   resizeMode:"strech", 
   borderBottomRightRadius: 200,
  },

 });
